INSERT INTO `textos_index` (`id`, `titulo`, `descricao`) VALUES
(7, 'Harmonização Facial', 'Harmonização Facial: Procedimentos combinados para equilibrar proporções faciais, corrigir imperfeições e proporcionar uma estética mais harmônica e jovial ao rosto.'),
(8, 'Preenchimento Labial', 'Preenchimento labial é o aumento de volume e definição nos lábios através da injeção de substâncias, melhorando o contorno e a aparência dos lábios.'),
(9, 'Massagem Focalizada', 'Massagem Focalizada: Aplica técnicas específicas em áreas problemáticas do corpo para aliviar tensões musculares e promover relaxamento localizado.'),
(10, 'Sessão Turbinada ', 'Massagem modeladora com ventosas: Utiliza ventosas para criar sucção na pele, melhorando a circulação sanguínea e reduzindo a celulite, promovendo um contorno corporal mais definido.'),
(11, 'Pantala', 'Pantala: Auxiliam na remodelagem corporal, para tratamento de celulite, combate a gordura localizada e flacidez tissular.'),
(12, 'Limpeza De Pele', 'Limpeza de pele: Procedimento estético que remove impurezas, células mortas e excesso de oleosidade da pele, desobstruindo poros, prevenindo acne e promovendo uma pele mais saudável e radiante.'),
(13, 'Detox Corporal', 'Detox corporal: é um procedimento estético indicado para eliminar toxinas do corpo, reduzir o inchaço e a retenção de líquidos, suavizar as celulites e auxiliar na perda de peso, por exemplo.'),
(14, 'Vibrocell', 'O Vibrocell é um aparelho de Endermoterapia vibratória, ou seja, seu sistema é capaz de produzir uma massagem altamente eficaz e profunda através de movimentos vibratórios e circulatórios diminuindo a celulite e a gordura localizada.');
